import React from 'react'
import styled from 'styled-components';

const Input = styled.input`
  width: 343px;
  height: 48px;
  float: left;
  background: #FFFFF;
  border-radius: 6px;
  border-color: #C1C1C1;
  box-shadow: none;
`;

class EmailField extends React.Component{
    render(){
        return(
        <div>
            <Input value="Email"/>
            <Input value="Password"/>
        </div>
        )
    }
}

export default EmailField;
